import React from 'react'
import './Navig.style.css'

import {Nav,NavbarToggler,Collapse,NavItem, Navbar, NavbarBrand, Jumbotron, Button, Modal, ModalHeader,ModalBody, Form, FormGroup,Label} from 'reactstrap'

import{NavigReus} from './NavigationReus'



class Navig extends Components {
    constructor(props){
        super(props);
        this.state ={
            isNavOpen: false
        }
    }

    openOrClose = () =>{
        this.setState({
            isNavOpen: !this.state.isNavOpen
        })
    }


    render(){
    return(
        <Navbar dark sticky='top' expand='md'>
            <div className="container">
                <NavbarBrand className='mr-auto' href="/home">Home</NavbarBrand>
                <NavbarToggler onClick={this.openOrClose} />

                <Collapse isOpen={this.state.isNavOpen} navbar>
                    <Nav navbar>
                        <NavigReus link={home} name={'Home'}/>
                        <NavigReus link={info} name={'About Us'}/>
                    </Nav>
                </Collapse>
            </div>
        </Navbar>               
    )
    }
}

export default Navig
